import '../style/App.css';
import {
    projects_mobile,
    projects_web,
    projects_embedded,
    projects_ml,
    projects_media
} from "../constants/projects.js";
import Project from "../components/portfolio/Project";
import WebProjectDisplay from "../components/portfolio/WebProjectDisplay";
import MobileProjectDisplay from "../components/portfolio/MobileProjectDisplay";
import EmbeddedProjectDisplay from "../components/portfolio/EmbeddedProjectDisplay";
import MLProjectDisplay from "../components/portfolio/MLProjectDisplay";
import MediaProjectDisplay from "../components/portfolio/MediaProjectDisplay";

const Portfolio = () => {
    const webProjects = projects.web;
    const mobileProjects = projects.mobile;
    const embeddedProjects = projects.embedded;
    const mlProjects = projects.ml;
    const mediaProjects = projects.media;

    return (
        <div className="Body">
            <h1>Portfolio</h1>
            <h2 id="web">Web</h2>
            {projects_web.map((project: any) =>
                <Project key={project.title} project={project} />
            )}
            <h2 id="mobile">Mobile Apps</h2>
            {projects_mobile.map((project: any) =>
                <div className="project">
                    <div className="project-left">
                        <Project key={project.title} project={project} />                    </div>
                    <div className="project-right">
                        <MobileProjectDisplay project={project} />
                    </div>
                </div>
            )}
            <h2 id="embedded">Embedded Systems</h2>
            {projects_embedded.map((project: any) =>
                <div className="project">
                    <div className="project-left">
                        <Project key={project.title} project={project} />                    </div>
                    <div className="project-right">
                        <EmbeddedProjectDisplay project={project} />
                    </div>
                </div>
            )}
            <h2 id="ml">Machine Learning</h2>
            {projects_ml.map((project: any) =>
                <div className="project">
                    <div className="project-left">
                        <Project key={project.title} project={project} />                    </div>
                    <div className="project-right">
                        <MLProjectDisplay project={project} />
                    </div>
                </div>
            )}
            <h2 id="media">Multimedia Processing</h2>
            {projects_media.map((project: any) =>
                <div className="project">
                    <div className="project-left">
                        <Project key={project.title} project={project} />                    </div>
                    <div className="project-right">
                        <MediaProjectDisplay project={project} />
                    </div>
                </div>
            )}
        </div>
    );
}

export default Portfolio;
